import React from 'react'

class FirstTabs extends React.Component {
    constructor(props) {
        super(props)
    }

    render() {
        return (
            <>
                {
          this.props.tabList.map((ta, index) => (
          <div className={style.tabList} key={index}>
           
          </div>
          ))
        }
            </>
        )
    }

}

export default FirstTabs
